import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { AuthProvider } from './context/AuthContext';
import ProtectedRoute from './components/ProtectedRoute';
import ErrorBoundary from './components/ErrorBoundary';
import Layout from './components/Layout';
import Home from './pages/Home';
import Login from './pages/Login';
import Dashboard from './pages/Dashboard';
import ChurchCalendar from './pages/ChurchCalendar';
import LiveStreaming from './pages/LiveStreaming';
import MemberDirectory from './pages/MemberDirectory';
import SabbathSchool from './pages/departments/SabbathSchool';
import AdventistYouth from './pages/departments/AdventistYouth';
import Treasury from './pages/departments/Treasury';
import Communication from './pages/departments/Communication';
import { HealthMinistries, FamilyMinistries, PARL, ChildrensMinistries } from './pages/departments/OtherDepartments';

function App() {
  // Clear localStorage to reset session
  localStorage.clear();

  return (
    <ErrorBoundary>
      <AuthProvider>
        <Router>
          <div className="App">
            <Routes>
              {/* Public Website Routes */}
              <Route path="/" element={<Home />} />
              <Route path="/login" element={<Login />} />

              {/* Protected Portal Routes */}
              <Route 
                path="/dashboard" 
                element={
                  <ProtectedRoute>
                    <Layout>
                      <Dashboard />
                    </Layout>
                  </ProtectedRoute>
                } 
              />

              {/* New Feature Routes */}
              <Route 
                path="/calendar" 
                element={
                  <ProtectedRoute>
                    <Layout>
                      <ChurchCalendar />
                    </Layout>
                  </ProtectedRoute>
                } 
              />
              <Route 
                path="/live" 
                element={
                  <ProtectedRoute>
                    <Layout>
                      <LiveStreaming />
                    </Layout>
                  </ProtectedRoute>
                } 
              />
              <Route 
                path="/members" 
                element={
                  <ProtectedRoute>
                    <Layout>
                      <MemberDirectory />
                    </Layout>
                  </ProtectedRoute>
                } 
              />

              {/* Department Routes */}
              <Route 
                path="/departments/sabbath-school" 
                element={
                  <ProtectedRoute>
                    <Layout>
                      <SabbathSchool />
                    </Layout>
                  </ProtectedRoute>
                } 
              />
              <Route 
                path="/departments/ay-pathfinder" 
                element={
                  <ProtectedRoute>
                    <Layout>
                      <AdventistYouth />
                    </Layout>
                  </ProtectedRoute>
                } 
              />
              <Route 
                path="/departments/childrens-ministries" 
                element={
                  <ProtectedRoute>
                    <Layout>
                      <ChildrensMinistries />
                    </Layout>
                  </ProtectedRoute>
                } 
              />
              <Route 
                path="/departments/communication" 
                element={
                  <ProtectedRoute>
                    <Layout>
                      <Communication />
                    </Layout>
                  </ProtectedRoute>
                } 
              />
              <Route 
                path="/departments/health-ministries" 
                element={
                  <ProtectedRoute>
                    <Layout>
                      <HealthMinistries />
                    </Layout>
                  </ProtectedRoute>
                } 
              />
              <Route 
                path="/departments/family-ministries" 
                element={
                  <ProtectedRoute>
                    <Layout>
                      <FamilyMinistries />
                    </Layout>
                  </ProtectedRoute>
                } 
              />
              <Route 
                path="/departments/parl" 
                element={
                  <ProtectedRoute>
                    <Layout>
                      <PARL />
                    </Layout>
                  </ProtectedRoute>
                } 
              />
              <Route 
                path="/departments/treasury" 
                element={
                  <ProtectedRoute>
                    <Layout>
                      <Treasury />
                    </Layout>
                  </ProtectedRoute>
                } 
              />
            </Routes>
          </div>
        </Router>
      </AuthProvider>
    </ErrorBoundary>
  );
}

export default App;
